import React, { useEffect, useState } from 'react';
import { Data } from '../interfaces/Data';
import { useBookingContext } from '../components/ContexApplication';
import "../css/selectedRoom.css";
interface SelectedRoomsProps {
    data: Data[];
    onNext: () => void;
    onPrevious: () => void;
}

export const SelectedRooms: React.FC<SelectedRoomsProps> = ({ data, onNext, onPrevious }) => {
    const { getGuestInfo, setBookingData, bookingData } = useBookingContext();
    const StatGuestFormatted = getGuestInfo("stat");
    const totalGuest = getGuestInfo('sum') as number;

    const [selectedRooms, setSelectedRooms] = useState<Data[]>([]);
    const [availableRooms, setAvailableRooms] = useState<Data[]>([]);
    console.log(bookingData);
    useEffect(() => {
        const filteredRooms = data.filter(room => !room.booked);
        setAvailableRooms(filteredRooms);
    }, [data]);

    const handleRoomSelection = (room: Data) => {
        const isSelected = selectedRooms.some((selectedRoom) => selectedRoom.id === room.id);
        if (isSelected) {
            const updatedRooms = selectedRooms.filter((selectedRoom) => selectedRoom.id !== room.id);
            setSelectedRooms(updatedRooms);
        } else {
            const totalGuestSelected = selectedRooms.reduce((total, selectedRoom) => total + selectedRoom.maxGuest, 0);
            const newTotalGuest = totalGuestSelected + room.maxGuest;
            if (newTotalGuest <= totalGuest) {
                setSelectedRooms([...selectedRooms, room]);
            } else {
                alert('Cannot select more rooms than the total number of guests.');
            }
        }
    };

    const handleNext = () => {
        const totalSelectedGuests = selectedRooms.reduce((total, selectedRoom) => total + selectedRoom.maxGuest, 0);
        if (totalSelectedGuests >= totalGuest) {
            onNext();
            setBookingData(prev => ({
                ...prev,
                roomSelected: [...(prev.roomSelected || []), ...selectedRooms]
            }));
        } else {
            alert('You must select enough rooms to accommodate all guests.');
        }
    };

    return (
        <div className="SelectedRoomsConteiner">
            <div className='SelectedRooms flex'>
                <div className='Header flex'>
                    <div>
                    <button onClick={onPrevious} className='prevuisPage'>Prevuis Page</button>
                    </div>
                    <div>
                        <h1 style={{ textAlign: "center" , fontSize:"2rem"}}>SELECT ROOM</h1>
                    </div>
                    <div className='GuestSelectedInformation'>
                        <label 
                            htmlFor="StatGuestFormatted"
                            style={{fontSize:"1rem", fontWeight:"bold", marginRight:"1em"}}
                        >GUEST SELECTED
                        </label>
                        <input type="text"
                            readOnly
                            value={StatGuestFormatted}
                            style={{fontWeight:"bold", padding:"0.4em",
                                   minWidth:"20rem", backgroundColor:"rgb(92, 92, 92)"}}

                        />
                    </div>

                </div>

                {availableRooms.map((room) => (
                    <div key={room.id} className='SelectedRoomsItem'>
                        <div className='SelectedImage'>
                            <img src={room.src} alt={room.category} style={{ minWidth: "40rem", height: "20rem", objectFit: "cover" }} />
                        </div>
                        <div className='SelectedRoomsDescription'>
                            <h2>{room.category}</h2>
                            <p>Description: {room.description}</p>
                            <p>Price: {room.price}$</p>
                            <p>Max Guests: {room.maxGuest}</p>
                            <button onClick={() => handleRoomSelection(room)} className='RoomSelectorBotton'>
                                {selectedRooms.some((selectedRoom) => selectedRoom.id === room.id) ? 'Deselect' : 'Select'}
                            </button>
                        </div>
                    </div>
                ))}
            </div>
            <div className='BottonNext'>
                <button onClick={handleNext}>Next</button>
            </div>
        </div>
    );
};
